const Checkbox = () => {
  return (
    <div className="flex text-p2">
      <input type="checkbox" id="elem" />
      <div className="flex pl-2.5">
        Я согласен с обработкой персональных данных
      </div>
    </div>
  );
};
export default Checkbox;
